package uploadImageSoap;

import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.File;
import java.io.IOException;

import javax.imageio.ImageIO;
import javax.jws.WebService;
import sun.misc.BASE64Decoder;

@WebService(endpointInterface = "uploadImageSoap.UploadImageInterface")
public class UploadImageController implements UploadImageInterface{
	
	private static String dirImg;

	public void uploadImage(String b64) throws IOException {
		// Path path = FileSystems.getDefault().getPath(filePath);
		BASE64Decoder decoder = new BASE64Decoder();
		byte[] decodedB = decoder.decodeBuffer(b64);
		System.out.println("Decoded upload data: " + b64.length());

		String uploadFile = "./teste.png";
		System.out.println("File save path: " + uploadFile);

		try {
			BufferedImage image = ImageIO.read(new ByteArrayInputStream(decodedB));
			File f = new File(uploadFile);
			ImageIO.write(image, "png", f);
		} catch (NullPointerException ex) {
			System.out.println("Buffered Image is null" + ex.getMessage());
		}
	}

	/*public static void main(String[] args) throws IOException {
		uploadImage(
					"");
	}
*/

}
